package com.jsp.studyShare.model;public class User {    private String openid;    private String username;    private String password;    private String salt;    private String nickname;    private int gender;    private String avatarUrl;    private String country;    private String province;    private String city;    private String collection;    private String uploaded;    private String downloaded;    private int status;    public String getOpenid() {        return openid;    }    public void setOpenid(String openid) {        this.openid = openid;    }    public String getUsername() {        return username;    }    public void setUsername(String username) {        this.username = username;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public String getSalt() {        return salt;    }    public void setSalt(String salt) {        this.salt = salt;    }    public String getNickname() {        return nickname;    }    public void setNickname(String nickname) {        this.nickname = nickname;    }    public int getGender() {        return gender;    }    public void setGender(int gender) {        this.gender = gender;    }    public String getAvatarUrl() {        return avatarUrl;    }    public void setAvatarUrl(String avatarUrl) {        this.avatarUrl = avatarUrl;    }    public String getCountry() {        return country;    }    public void setCountry(String country) {        this.country = country;    }    public String getProvince() {        return province;    }    public void setProvince(String province) {        this.province = province;    }    public String getCity() {        return city;    }    public void setCity(String city) {        this.city = city;    }    public String getCollection() {        return collection;    }    public void setCollection(String collection) {        this.collection = collection;    }    public String getUploaded() {        return uploaded;    }    public void setUploaded(String uploaded) {        this.uploaded = uploaded;    }    public int getStatus() {        return status;    }    public void setStatus(int status) {        this.status = status;    }    public String getDownloaded() {        return downloaded;    }    public void setDownloaded(String downloaded) {        this.downloaded = downloaded;    }}